{
    "openapi": "3.0.0",
    "x-origin": [
        {
            "url": "https://raw.githubusercontent.com/okta/okta-management-openapi-spec/master/dist/spec.json",
            "format": "swagger",
            "version": "2.0",
            "converter": {
                "url": "https://github.com/mermade/oas-kit",
